import React, { useState, useEffect } from 'react';
import Axios from 'axios';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';

function Rental() {
  const [rentals, setRentals] = useState([]);

  useEffect(() => {
    Axios.get('http://127.0.0.1:8000/api/rentals/')
      .then((response) => {
        setRentals(response.data);
      })
      .catch((error) => {
        console.error('Error fetching rental data:', error);
      });
  }, []);

  return (
    <div>
      <Navbar expand="lg" className="bg-body-tertiary">
      <Container fluid>
        <Navbar.Brand href="http://localhost:3000">VehicleVerse</Navbar.Brand>
        <Navbar.Toggle aria-controls="vehicleerse" />
        <Navbar.Collapse id="vehicleverse">
          <Nav
            className="me-auto my-2 my-lg-0"
            style={{ maxHeight: '100px' }}
            vehicleverse
          >
            <Nav.Link href="http://localhost:3000">Home</Nav.Link>
            <Nav.Link href="http://localhost:3000/rental">Rent</Nav.Link>
            <NavDropdown title="POST" id="navbarScrollingDropdown">
            <NavDropdown.Item href="http://localhost:3000/sell/post">ADD For Sell</NavDropdown.Item>
              <NavDropdown.Item href="http://localhost:3000/rent/post">ADD For Rent</NavDropdown.Item>
            </NavDropdown>
            <Nav.Link href="http://localhost:3000/profile">
              Profile
            </Nav.Link>
            <Nav.Link href="http://127.0.0.1:8000/login/">Log Out</Nav.Link>
          </Nav>
          <Form className="d-flex">
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"
            />
            <Button variant="outline-success">Search</Button>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
      <Container className="mt-4">
        <h1 className="text-center">Rental Listings</h1>
        <Row>
          {rentals.map((rental) => (
            <Col key={rental.id} md={4}>
              <Card className="mb-4">
              <Card.Img
              src={rental.image_link}
              alt="Rental"
              style={{ height: '400px' }}
            />
                <Card.Body>
                <Card.Body>
                  <Card.Title>Vehicle Type: {rental.vehicle_type}</Card.Title>
                </Card.Body>
                <Card.Body>
                  <Card.Text>Phone Number: {rental.phone_number}</Card.Text>
                </Card.Body>
                <Card.Body>
                  <Card.Text>Model: {rental.model}</Card.Text>
                </Card.Body>
                <Card.Body>
                  <Card.Text>Description: {rental.description}</Card.Text>
                </Card.Body>
                <Card.Body>
                  <Card.Text>Price: {rental.price}</Card.Text>
                </Card.Body>
                <Card.Body>
                  <Card.Text>Is Available: {rental.is_available ? 'Yes' : 'No'}</Card.Text>
                  </Card.Body>
                </Card.Body>
              </Card>
            </Col>
          ))}
        </Row>
      </Container>
    </div>
  );
}

export default Rental;
